import React from 'react'
import logoIcon from './images/logo-icon.png'

import user from './images/orgxtopaz.png'
import './css/custom.css';
import { useHistory } from "react-router-dom"; // allows us to access our path / route history.
import Axios from "axios"; //allows us to make GET and POST requests from the browser.
import { useEffect } from "react"; //a hook that GIVES  "side-effects"

function UserBusiness() {

  let history = useHistory(); //USE HISTORY  it will DETERMINED OUR PAST PATH.
  const isLoaded = [true];
  useEffect(() => {

     if (isLoaded) {
      Axios.post("http://localhost:5000/login", 

      { 
        
        
        email: localStorage.getItem("email"),
        password: localStorage.getItem("password")
      
      }
      
      )
    
      
      .then((res) => {
        if(res.data.position ==="user"){ 
         
        }else{
          history.push("/")
          window.location.reload();  
        }
      


     
      })
      .catch((error) => {
        history.push("/")


      })

    }else{
      console.log("ERROR")
    }


  }, isLoaded);
  function Logout(){
    localStorage.clear()
    window.location.reload()
  }
  return (


    <div>
    {/* ============================================================== */}
    {/* Preloader - style you can find in spinners.css */}
    {/* ============================================================== */}
    <div className="preloader">
      <div className="lds-ripple">
        <div className="lds-pos" />
        <div className="lds-pos" />
      </div>
    </div>
    {/* ============================================================== */}
    {/* Main wrapper - style you can find in pages.scss */}
    {/* ============================================================== */}
    <div id="main-wrapper" data-layout="vertical" data-navbarbg="skin5" data-sidebartype="full" data-sidebar-position="absolute" data-header-position="absolute" data-boxed-layout="full">
      {/* ============================================================== */}
      {/* Topbar header - style you can find in pages.scss */}
      {/* ============================================================== */}
      <header className="topbar" data-navbarbg="skin5" style={{backgroundColor:"#0b2972"}}>
        <nav className="navbar top-navbar navbar-expand-md navbar-dark" style={{backgroundColor:"#0b2972"}}>
          <div className="navbar-header" data-logobg="skin5" style={{backgroundColor:"#0b2972"}}>
            {/* ============================================================== */}
            {/* Logo */}
            {/* ============================================================== */}
            <a className="navbar-brand" href="/">
              {/* Logo icon */}
              <b className="logo-icon">
                {/* Dark Logo icon */}
                <img src="https://i.scdn.co/image/ab6761610000e5ebc02d416c309a68b04dc94576" alt="homepage" className="dark-logo" />
                {/* Light Logo icon */}
              </b>
              {/*End Logo icon */}
              {/* Logo text */}
              <span className="logo-text">
                {/* dark Logo text */}
                <img src={logoIcon}alt="homepage" className="dark-logo" />
                {/* Light Logo text */}
                {/* <img src={lightLogo} className="light-logo" alt="homepage" /> */}
              </span>
            </a>
            {/* ============================================================== */}
            {/* End Logo */}
            {/* ============================================================== */}
            {/* This is for the sidebar toggle which is visible on mobile only */}
            <a className="nav-toggler waves-effect waves-light d-block d-md-none" href="javascript:void(0)"><i className="ti-menu ti-close" /></a>
          </div>
          {/* ============================================================== */}
          {/* End Logo */}
          {/* ============================================================== */}
          <div className="navbar-collapse collapse" id="navbarSupportedContent" data-navbarbg="skin5">
            {/* ============================================================== */}
            {/* toggle and nav items */}
            {/* ============================================================== */}
          
            {/* ============================================================== */}
            {/* Right side toggle and nav items */}
            {/* ============================================================== */}
           
          </div>
        </nav>
      </header>
      {/* ============================================================== */}
      {/* End Topbar header */}
      {/* ============================================================== */}
      {/* ============================================================== */}
